import React, { Component } from 'react';
import ScriptTag from 'react-script-tag';

export default class EXTJS extends Component {

    render() {
        return (
            <div>
                <ScriptTag isHydrating={true} type="text/javascript" src="assets/js/jquery/jquery.min.js" />
                <ScriptTag isHydrating={true} type="text/javascript" src="assets/js/jquery-ui/jquery-ui.min.js" />
                <ScriptTag isHydrating={true} type="text/javascript" src=" assets/js/script.js" />

            </div>
        );
    }
}
